bh_pub_LAYERDESC:
60-75% Tonstein, Tonmergelstein und Mergelkalkstein, dunkelbunt, wie zuvor; 25-35% Grobsandstein bis Mittelsandstein, seltener Feinmittelsandstein, wie zuvor, selten etwas stärker Glimmer führend, wechselnder Anteil seltener grüner Körner; 
0 bis ca. 5% Feinmittelsandstein bis Feinsandstein, meist dunkelbunt, wie zuvor selten sehr stark Glimmer führend;
0 bis ca. 1% Mergelstein, hellgrau, bräunlich und rötlich, stark zerbohrt, wie zuvor. 
Seltene Bröckchen von Kalzit, seltene kleine Kalzitkristalle, ganz wenige Brocken Grobsandstein mit einzelnen Kieskomponenten bis 2 mm Ø, z.B. in Sp.2670 m, seltene Harnisch-andeutungen an Kalzitbröckchen und Tonsteinbröckchen. Seltene Brocken dunkelgrauen Tonsteins, etwas ?kohliger Tonstein in allen Proben.
In Sp. 2730 + 2735 m besonders viel bis zu 60% grobe Brocken (wohl Nachfall).

60% Tonstein etc. wie zuvor;
35% Mittelsandstein, Feinsandstein und Grobsandstein wie zuvor;
5% Mergelstein, hellgrau, weißlichgrau (?zerbohrter Kalzit), stark zerbohrt, wenige Brocken Kalzit mit z.T. gerieften Harnischen; wenige Grobsandsteinbrocken, stark kalkig mit bis zu 10% bunten (meist rosa und grüne) Körnern und einzelnen bis zu 1,5 mm großen Glimmerblättchen; seltene lakritzenartige ("Bärendreck") Kohlenwasserstoffbrocken wie in Sp. 2830 u. 2835 m.

70- 80% Tonmergelstein etc. wie zuvor; 
15-20% Grobsandstein bis Mittelsandstein, hellgrau, kalkig, dunkle und bunte Körner bis 20%;
1- 5% Feinsandstein, dunkelgrünlichgrau und z.T. bunt gefleckt, sonst wie zuvor. Seltene weiße Kalzitbröckchen (?Nachfall).

Kalkstein, dunkel- bis mittelgrau, gelegentlich schwach mergelig, feinkristallin, hart, splitterig brechend; ganz untergeordnet
Mergelkalkstein, dunkelgrau, z.T. schwach siltig, mittelhart, bröckelig brechend; vereinzelt hellgrauer Schmand; weißgraue Kalzitbröckchen; sehr selten hellbräunlichgrauer, glatter Kalkstein (Verunreinigung);
