Mergelstein, vorwiegend dunkelgrau, selten auch mittelgrau, schwach siltig- feinsandig, etwas feinstglimmerstaubig, fest, unregelmäßig-bröckeliger Bruch; etwas, in Sp. 1536 m bis ca. 80 %, ab Sp. 1538 m wieder abnehmend mittelgrauer, mergeliger Bohrschmand;
daneben in Sp. 1536 m ganz vereinzelt, in Sp. 1534 und ab 1538 m ziemlich untergeordnet Mergelkalk- bis Kalkmergelstein wie in Sp. 1530 + 1532 m; wenig, in z.T. bis 3 cm großen Brocken, dunkel- bis
schwarzgrauer Mergel- bis Tonmergelstein (Nachfall); vereinzelt Kluftkalzit.

